import React from "react";
import Slider from "react-slick";

const Projet = ({ titre, techno, description, images, link }) => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
  };

  return (
    <div className="projet">
      <h4>{titre}</h4>
      <h5>Technologies utilis√©es: {techno}</h5>

      <p>{description}</p>
      <Slider {...settings}>
        {images.map((image) => (
          <div key={image}>
            <img src={image} alt={titre} />
          </div>
        ))}
      </Slider>
      <p>{link}</p>
    </div>
  );
};

export default Projet;
